    .txt-link {
        color: #007bff;
        text-decoration: underline;
    }
    .giscaImg {
        position: absolute;
        bottom: 40px;
        right: 0;
        z-index: 6;
    }
    #footer {
        position: absolute;
        bottom: 0;
        display: grid;
        place-items: center;
        text-align: center;
        width: 100%;
        height: 65px;
        background: #FFAC00;
        color : #fff;
        z-index: 7;
        overflow: hidden;
    }
    .footerContent .desc1 {
        font-weight: 400;
        font-size: 16px;
        line-height: 22px;
        color : #fff;
    }
    .footerContent .desc2 {
        font-weight: 400;
        font-size: 14px;
        line-height: 21px;
        color : #fff;
    }
</style>

